var b="url",c="订单管理.html",d="generationDate",e=new Date(1572246286319.1),f="defaultAdaptiveView",g="name",h="",i="size",j="width",k=0,l="height",m="adaptiveViews",n="sketchKeys",o="s0",p="variables",q="OnLoadVariable",r="page",s="packageId",t="345e6810e95745368bf7c7389c96f440",u="type",v="Axure:Page",w="订单管理",x="notes",y="页面概述",z="<p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\"><br></span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">拆单订单，只展示子订单，拆单单号生成规则， 原订单号后+2为随机数</span></p>",A="annotations",B="fn",C="1",D="ownerId",E="f6452ca8c0f14d35af3adfeefa400e8e",F="label",G="订单编号",H="说明",I="<p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">订单编号编码规则：下单时间订单的unix时间戳后4位+4位随机码+商户编号后2位</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\"><br></span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">&nbsp; </span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\"><br></span></p>",J="2",K="533975701fdd4ae6a302360fe3c888d7",L="预置面板",M="<p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">预置面板：代付款，代发货，待收货，交易完成，售后订单（退款，退换货）</span></p>",N="3",O="fdee90e960ed4f1db58222ba947f1f01",P="订单详情",Q="<p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">点击新开标签页</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">操作项：代付款，，待收货，交易完成状态的订单仅可查看，不可编辑信息</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; 代发货：可填写运单号和物流公司</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 售后订单：对售后订单的处理</span></p>",R="4",S="320a5fa073b3403cb6e405fdb1be0bbb",T="(动态面板)",U="<p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">进度：</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">退款-----&nbsp; 同意：</span><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';color:#EA0808;\">等待处理</span><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">-等待退款-退款成功&nbsp; &nbsp;&nbsp; ---------交易关闭</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; 驳回：</span><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';color:#F60505;\">等待处理</span><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">-申请驳回&nbsp; &nbsp;&nbsp; ---------代发货-待收货-。。。。</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\"><br></span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">退货----- 同意：</span><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';color:#F60505;\">等待处理</span><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">-等待商家收货-等待退款-退款成功&nbsp; &nbsp; -------交易关闭</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; 驳回：</span><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';color:#F40404;\">等待处理</span><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">-申请驳回&nbsp; &nbsp; ---------交易完成</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\"><br></span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">换货----- 同意：</span><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';color:#F90606;\">等待处理</span><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">-等待商家收货-</span><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';color:#F70101;\">等</span><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';color:#F20404;\">待商家重新发货</span><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">-等待用户收货-交易完成&nbsp;&nbsp; -------交易完成</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; 驳回：</span><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';color:#F40101;\">等待处理</span><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">-申请驳回</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\"><br></span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">用户发起申请后撤回申请，不区分订单状态： 等待处理--用户撤回申请</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\"><br></span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">排序：</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">需要商户处理的单子排在前面，排序按申请售后时间升序排列；不需处理单子整体排在后面，不需处理单子按申请售后时间降序排列</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\"><br></span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\"><br></span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';color:#F90606;\">针对单独订单存有多次售后记录情况：按钮状态即列表显示信息以最新一次申请为准</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';color:#F90606;\">售后服务的订单状态为售后服务中，为单独一种订单状态，该状态订单无法在其他状态列表内查到，每个状态只展示该状态下订单</span></p>",V="5",W="e7963420723e4103a45642092d000b5f",X="退款原因：质量问题 退货申请时间：201",Y="<p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">申请时间</span><span>/</span><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">原因：前端用户发起时填写的原因及时间。标题随售后类型变化，即用户申请退货，标题为：退货原因，退货申请时间</span></p>",Z="6",ba="e8e3b0abb4f54a318a33631d2ead9d91",bb="收货人姓名：张易谋 用户账号：小黑黑 收",bc="<p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">用户账号：用户登陆app</span><span>/</span><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">小程序使用的账号，</span><span> </span></p>",bd="7",be="1daf2a4c65f642608e2065fbd71a3582",bf="订单状态：待发货 订单金额：¥1000.",bg="<p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">支付优惠：无为</span><span>0.00</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">订单金额：显示商品售价总额</span></p>",bh="8",bi="be19a44c80d3486dab2cd31fbfde63eb"